import { Link } from 'react-router-dom';
import './Dashboard.css'; // You can create this CSS file or use inline styles

const Dashboard = () => {
  return (
    <div className="dashboard-wrapper">
      <div className="dashboard-card">
        <h2 className="dashboard-title">ðŸš— User Dashboard</h2>
        <p className="dashboard-text">Welcome back! Ready to request assistance?</p>

        <div className="dashboard-buttons">
          <Link to="/request-help" className="dashboard-btn primary">Request Help</Link>
          <Link to="/" className="dashboard-btn secondary">Logout</Link>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
